import { Link } from "react-scroll"; // import Link from react-scroll
import { FaHome, FaUser, FaEnvelope } from "react-icons/fa";

const Navbar = () => {
  return (
    <nav className="bg-gray-900 p-4 shadow-lg fixed w-full z-10">
      <div className="max-w-6xl mx-auto flex items-center justify-between">
        <Link
          to="home" // Linking to home section
          smooth={true} // Smooth scroll
          duration={500} // Smooth scroll duration in ms
          className="text-white text-3xl font-semibold hover:text-gray-300 transition duration-300"
        >
          Ayush.
        </Link>
        <div className="hidden md:flex space-x-8">
          <Link
            to="home"
            smooth={true}
            duration={500}
            className="text-white text-lg hover:text-gray-300 transition duration-300 relative group"
          >
            Home
          </Link>
          <Link
            to="projects"
            smooth={true}
            duration={500}
            className="text-white text-lg hover:text-gray-300 transition duration-300 relative group"
          >
            Projects
          </Link>
          <Link
            to="skills"
            smooth={true}
            duration={500}
            className="text-white text-lg hover:text-gray-300 transition duration-300 relative group"
          >
            Skills
          </Link>
          <Link
            to="letsconnect"
            smooth={true}
            duration={500}
            className="text-white text-lg hover:text-gray-300 transition duration-300 relative group"
          >
            Let's Connect
          </Link>
        </div>
        <div className="md:hidden flex items-center space-x-4">
          <Link
            to="home"
            smooth={true}
            duration={500}
            className="text-white text-xl hover:text-gray-300 transition duration-300"
          >
            <FaHome />
          </Link>
          <Link
            to="projects"
            smooth={true}
            duration={500}
            className="text-white text-xl hover:text-gray-300 transition duration-300"
          >
            <FaUser />
          </Link>
          <Link
            to="letsconnect"
            smooth={true}
            duration={500}
            className="text-white text-xl hover:text-gray-300 transition duration-300"
          >
            <FaEnvelope />
          </Link>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
